import React, { Fragment } from "react";
import Selector from "../../UI/Selector";
import Artist from "../TopTracks/Artists";

const TopArtists = (props) => {
  console.log(props.topArtists);
  const items = props.topArtists.items;
  console.log(items);

  const allTimeTopArtists = () => {
    props.setTopArtistsTimeFrame("long_term");
  };

  const sixMonthsTopArtists = () => {
    props.setTopArtistsTimeFrame("medium_term");
  };

  const lastMonthTopArtists = () => {
    props.setTopArtistsTimeFrame("short_term");
  };

  return (
    <Fragment>
      <h1>The Top Artists Page</h1>
      <Selector allTime={allTimeTopArtists} sixMonths={sixMonthsTopArtists} lastTime={lastMonthTopArtists} />
      <Artist artists={props.topArtists.items}/>
    </Fragment>
  );
};

export default TopArtists;
